import React from 'react';  
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';  
import Home from './components/Home'; // Adjusted path to Home component  
import Winners from './components/Winners'; // Adjusted path to Winners component  
import PastWinners from './components/PastWinners'; // Adjusted path to PastWinners component  
import Navbar from './components/Navbar'; // Adjusted path to Navbar component  

const App = () => {  
    return (  
        <Router>  
            <Navbar /> {/* Include your Navbar if you have one */}  
            <Routes>  
                <Route path="/" element={<Home />} />  
                <Route path="/winners" element={<Winners />} />  
                <Route path="/past-winners" element={<PastWinners />} />  
            </Routes>  
        </Router>  
    );  
};  

export default App;
